import React, { Component } from 'react'
import { Link } from 'react-router-dom'

export default class BannerItem extends Component {
    render() {
        let { item } = this.props
        return (
            <li data-toggle="tooltip" data-placement="right" title={item.moTa}>
                <Link to="/courses">



                    {item.tenDanhMuc}
                </Link>
            </li>
        )
    }
}
